var tipuesearch = {"pages": [{'title': 'About40823115', 'text': '\n \n \n \n 此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git', 'tags': '', 'url': 'About40823115.html'}, {'title': 'w1', 'text': '. \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2-w3', 'text': '\n \n', 'tags': '', 'url': 'w2-w3.html'}, {'title': 'w3-w4', 'text': '\n', 'tags': '', 'url': 'w3-w4.html'}, {'title': 'w5-w6', 'text': '', 'tags': '', 'url': 'w5-w6.html'}, {'title': 'w7-w8', 'text': '工程師 \n 1.creat具有創造性 工程職業人員需擁有條件\xa0發明 設計 分析 構建\xa0\xa0且經過\xa0反覆測試 2.聰明精巧且正確的配置 數學英文很重要 (用於工程師之間溝通) mathematics數學分析能力 scientific principles 科學原理分析能力 \n \n \n', 'tags': '', 'url': 'w7-w8.html'}, {'title': 'w9-w10', 'text': '', 'tags': '', 'url': 'w9-w10.html'}, {'title': 'w11-w12', 'text': '', 'tags': '', 'url': 'w11-w12.html'}, {'title': 'w13-w14', 'text': '', 'tags': '', 'url': 'w13-w14.html'}, {'title': 'w15-w17', 'text': '\n', 'tags': '', 'url': 'w15-w17.html'}, {'title': 'w18', 'text': '\n', 'tags': '', 'url': 'w18.html'}]};